import numpy as np
def bestClosingTime(customers: str) -> int:
    penalties = [0] * (len(customers) + 1)
    for i, stat in enumerate(customers):
        if stat == "Y":
            for j in range(i+1):
                penalties[j] += 1
        else:
            for j in range(i+1, len(customers)+1):
                penalties[j] += 1
    return np.argmin(penalties)

